pg" style="height:532px;width:960px;"></div></div></div></div><div style="clear: both;" class="module module-Menu"><div class="module-content tm-menu tm-menu-8" style="width: 958px; height: auto; background-color: rgb(59, 51, 51);"><ul class="menu"><li attr="2263" class="root"><a href="/">Strona glowna</a></li><li attr="8478" class="root"><a href="/galeria.html">Galeria</a></li><li attr="9228" class="root"><a href="/kontakt.html">Kontakt</a></li></ul></div></div></div><div style="" id="col960menu" class="column col960menu"></div><div style="" id="col960content" class="column col960content"><div class="module module-text" style="clear: both;"><div style="background-image: none;"><div><div><h1>O nas</h1></div><div><div><div style="text-align: justify;" data-mce-style="text-align: justify;"><span style="font-size: 14pt;" data-mce-style="font-size: 14pt;">Prozno pisac, ze gramy najlepiej na swiecie, ze gramy najwieksze przeboje lat 60, 70, 80, 90 oraz wszystkie obecne hity i ze impreza z nami, to niezapomniane wrazenia, ktore zapamietacie do konca zycia, bo taka informacje znajdziecie na wszystkich stronach internetowych zespolow. My po prostu, staramy sie najlepiej jak potrafimy przekazac nasze mizerne zdolnosci muzyczne, ktore przez piec par rak sa przekazywane na trzy klawiatury, dwa gryfy i perkusje. Mozemy tylko Was zapewnic, ze to co, slyszeliscie lub uslyszycie z naszych glosnikow, to dzwieki, ktore powstaly w wyniku przycisniecia klawisza, tracenia w strune czy uderzenia w bebny. Reasumujac, podczas naszych wystepow wyklucza sie udzial osob trzecich (aranzerow, producentow plikow midi, zwolennikow playbackow, polplaybackow, cwiercplaybackow itp.). Mozemy jeszcze dodac, ze nasza wspolna przygoda z muzyka trwa juz 20 lat. Ile jeszcze potrwa, zalezy tylko od Was jak dlugo zechcecie nas goscic na swoich imprezach.</span></div><br><br><span style="font-size: 14pt;" data-mce-style="font-size: 14pt;">Zapraszamy</span><br><span style="font-size: 14pt;" data-mce-style="font-size: 14pt;">Zespol VOLTER</span></div></div></div></div></div></div><div style="" id="col960footer" class="column col960footer"><div class="module module-text" style="clear: both;"><div style="">Copyright volter.pl</div></div></div></div></body></html>

